import React from "react";

function Footer() {
    return <>
        <footer>
            <div className="container">
                <div>Icons</div>
                <div>hello@yay.com</div>
                <div>Copywright 2021</div>
            </div>
        </footer>;
    </>;
}

export default Footer;
